import React, { useContext, useState, useEffect } from "react";

function UserPage(params) {
  const [users, setUsers] = useState([]);



  return (
    <React.Fragment>
      <h1>this is User page</h1>
      {users.map((user) => (
        <li>{user}</li>
      ))}
    </React.Fragment>
  );
}

export default UserPage;
